impl Solution {
    pub fn delete_duplicates(head: Option<Box<ListNode>>) -> Option<Box<ListNode>> {
        let mut vals = Vec::new();
        let mut cur = head;
        while let Some(item) = cur {
            vals.push(item.val);
            cur = item.next;
        }
        vals.dedup();
        let mut cur = None;
        for val in vals.into_iter().rev() {
            cur = Some(Box::new(ListNode { val, next: cur }));
        }
        cur
    }
}
